import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import AboutMeGif from "../images/aboutme.gif";

function About() {
    return(
        <Container>
            <Row className = "d-flex justify-content-center">
                <h3>About Me</h3>
            </Row>
            <Row>
                <Col className = "d-flex justify-content-center">
                    <img src = {AboutMeGif} alt="gif" width="250" height="250"/>
                </Col>
                <Col>
                    <p>Hello and thank you for visiting my website!<br/><br/>
                    My name is Ellie and I am currently pursuing a full stack web development certificate through the University of Washington's Coding Bootcamp Program. I am also a student at the Academy of Art University pursuing my MFA. 
                    <br/><br/>
                    Feel free to check out my highlighted projects in my <button variant="link" href="https://www.github.com" target="_blank">portfolio page</button>; if you have any questions or comments, you can reach out to me in my <button variant="link" href="https://www.github.com" target="_blank">contact page</button>.<br/><br/>Thanks again for stopping by!
                    </p>
                </Col>
            </Row>

        </Container>        
    )
}

export default About;
